import "./card.scss";

function Card() {



    <div className="container">
    <div className="row">

      {
        products.map((product) => {

          return <div className="col-md-4">
            <div className="m-2 p-1">
              <p>{product.name}</p>
              <p>{product.descrition}</p>
              <img src={product.imageURL} alt="" className="product-img" />

            </div>

          </div>

        }
        )
      }


    </div>

  </div>






}





export default Card;
